import React, { useEffect, useState } from 'react';

interface ResponseData {
  control_ctr: number;
  p_value: number | null;
  status: string;
  variant_ctr: number;
  winner: string;
}

const TestResults: React.FC = () => {
  const [responseData, setResponseData] = useState<ResponseData | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:5000/calculate_ab_test_winner?test_id=123');
        const data = await response.json();
        setResponseData(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="container">
      {responseData ? (
        <div>
          <h1>AB Test Results</h1>
          <div className="result">
            <p>Control CTR: {responseData.control_ctr}</p>
            <p>Variant CTR: {responseData.variant_ctr}</p>
            <p>P-value: {responseData.p_value}</p>
            <p>Winner: {responseData.winner}</p>
          </div>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default Test;
